import React from 'react';
import ReactDom from 'react-dom'
import './App.css'
import Header from './Header';
import MainContent from './MainContent';
import Footer from './Footer';

function App() {
  return (
    <>
      <Header />
      <MainContent />
      <Footer />
    </>
  )
}

ReactDom.render(
  <Page />,
  document.getElementById('root')
);
